import React from 'react';

const Navbar = ({ currentPage, onNavigate, currentUser, onLogout }) => {
  return (
    <>
      {/* Glassmorphism Navigation Bar */}
      <nav style={{
        background: 'rgba(255, 255, 255, 0.95)',
        backdropFilter: 'blur(20px)',
        WebkitBackdropFilter: 'blur(20px)',
        boxShadow: '0 -8px 32px rgba(0, 0, 0, 0.12)',
        padding: '16px 0 24px 0',
        position: 'fixed',
        bottom: 0,
        left: 0,
        right: 0,
        zIndex: 100,
        borderTop: '1px solid rgba(255, 255, 255, 0.2)'
      }}>
        {/* Navigation Container */}
        <div style={{
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'end',
          maxWidth: '100%',
          position: 'relative',
          paddingBottom: '8px'
        }}>
          {/* Home Tab */}
          <button 
            onClick={() => onNavigate('dashboard')}
            style={{
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              gap: '4px',
              padding: '12px 24px',
              background: 'none',
              border: 'none',
              cursor: 'pointer',
              fontSize: '10px',
              fontWeight: '600',
              letterSpacing: '0.5px',
              transition: 'all 0.4s cubic-bezier(0.4, 0, 0.2, 1)',
              color: currentPage === 'dashboard' ? '#4CAF50' : '#9CA3AF',
              transform: currentPage === 'dashboard' ? 'translateY(-2px)' : 'translateY(0)',
              minWidth: '80px'
            }}
          >
            <div style={{
              width: '32px',
              height: '32px',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              borderRadius: '12px',
              background: currentPage === 'dashboard' 
                ? 'linear-gradient(135deg, rgba(76, 175, 80, 0.2), rgba(76, 175, 80, 0.1))' 
                : 'transparent',
              border: currentPage === 'dashboard' ? '1px solid rgba(76, 175, 80, 0.3)' : 'none',
              transition: 'all 0.4s ease'
            }}>
              <i className={currentPage === 'dashboard' ? 'fas fa-home' : 'far fa-home'} style={{ 
                fontSize: '16px',
                color: currentPage === 'dashboard' ? '#4CAF50' : '#9CA3AF'
              }}></i>
            </div>
            <span style={{ textTransform: 'uppercase' }}>Home</span>
            {currentPage === 'dashboard' && (
              <div style={{
                width: '4px',
                height: '4px',
                borderRadius: '50%',
                background: '#4CAF50',
                marginTop: '2px'
              }} />
            )}
          </button>

          {/* Floating Add Button */}
          <button 
            onClick={() => onNavigate('upload')}
            style={{
              position: 'relative',
              width: '64px',
              height: '64px',
              borderRadius: '50%',
              background: 'linear-gradient(135deg, #4CAF50 0%, #45a049 50%, #66BB6A 100%)',
              border: '3px solid rgba(255, 255, 255, 0.9)',
              cursor: 'pointer',
              boxShadow: currentPage === 'upload' 
                ? '0 8px 32px rgba(76, 175, 80, 0.6), 0 0 0 4px rgba(76, 175, 80, 0.2)'
                : '0 6px 24px rgba(76, 175, 80, 0.4), 0 2px 8px rgba(0, 0, 0, 0.1)',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              transition: 'all 0.4s cubic-bezier(0.4, 0, 0.2, 1)',
              transform: currentPage === 'upload' ? 'scale(1.1) translateY(-4px)' : 'scale(1) translateY(-8px)',
              margin: '0 16px'
            }}
          >
            <i className="fas fa-plus" style={{ 
              fontSize: '20px',
              color: 'white',
              transform: currentPage === 'upload' ? 'rotate(45deg)' : 'rotate(0deg)',
              transition: 'transform 0.3s ease'
            }}></i>

            {/* Pulse Animation */}
            {currentPage === 'upload' && (
              <div style={{
                position: 'absolute',
                width: '100%',
                height: '100%',
                borderRadius: '50%',
                background: 'rgba(76, 175, 80, 0.3)',
                animation: 'pulse 2s infinite'
              }} />
            )}
          </button>

          {/* History Tab */}
          <button 
            onClick={() => onNavigate('history')}
            style={{
              display: 'flex',
              flexDirection: 'column',
              alignItems: 'center',
              gap: '4px',
              padding: '12px 24px',
              background: 'none',
              border: 'none',
              cursor: 'pointer',
              fontSize: '10px',
              fontWeight: '600',
              letterSpacing: '0.5px',
              transition: 'all 0.4s cubic-bezier(0.4, 0, 0.2, 1)',
              color: currentPage === 'history' ? '#FF9800' : '#9CA3AF',
              transform: currentPage === 'history' ? 'translateY(-2px)' : 'translateY(0)',
              minWidth: '80px'
            }}
          >
            <div style={{
              width: '32px',
              height: '32px',
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              borderRadius: '12px',
              background: currentPage === 'history' 
                ? 'linear-gradient(135deg, rgba(255, 152, 0, 0.2), rgba(255, 152, 0, 0.1))' 
                : 'transparent',
              border: currentPage === 'history' ? '1px solid rgba(255, 152, 0, 0.3)' : 'none',
              transition: 'all 0.4s ease'
            }}>
              <i className={currentPage === 'history' ? 'fas fa-history' : 'far fa-clock'} style={{ 
                fontSize: '16px',
                color: currentPage === 'history' ? '#FF9800' : '#9CA3AF'
              }}></i>
            </div>
            <span style={{ textTransform: 'uppercase' }}>History</span>
            {currentPage === 'history' && (
              <div style={{
                width: '4px',
                height: '4px',
                borderRadius: '50%',
                background: '#FF9800',
                marginTop: '2px'
              }} />
            )}
          </button>
        </div>

        {/* Home Indicator */}
        <div style={{
          width: '134px',
          height: '5px',
          borderRadius: '3px',
          background: 'rgba(0, 0, 0, 0.3)',
          margin: '8px auto 0',
          opacity: 0.6
        }} />
      </nav>

      {/* Floating Logout Button */}
      <button
        onClick={onLogout}
        style={{
          position: 'fixed',
          top: '60px',
          right: '20px',
          width: '44px',
          height: '44px',
          borderRadius: '50%',
          background: 'rgba(255, 255, 255, 0.95)',
          backdropFilter: 'blur(20px)',
          WebkitBackdropFilter: 'blur(20px)',
          border: '1px solid rgba(255, 255, 255, 0.3)',
          cursor: 'pointer',
          display: 'flex',
          alignItems: 'center',
          justifyContent: 'center',
          boxShadow: '0 4px 16px rgba(0, 0, 0, 0.12), 0 2px 4px rgba(0, 0, 0, 0.08)',
          transition: 'all 0.3s ease',
          zIndex: 99
        }}
        onMouseEnter={(e) => {
          e.target.style.transform = 'scale(1.1)';
          e.target.style.boxShadow = '0 6px 20px rgba(0, 0, 0, 0.15)';
        }}
        onMouseLeave={(e) => {
          e.target.style.transform = 'scale(1)';
          e.target.style.boxShadow = '0 4px 16px rgba(0, 0, 0, 0.12)';
        }}
      >
        <i className="fas fa-sign-out-alt" style={{ 
          fontSize: '16px',
          color: '#6B7280'
        }}></i>
      </button>

      {/* CSS Animations */}
      <style>
        {`
          @keyframes pulse {
            0% {
              transform: scale(1);
              opacity: 1;
            }
            50% {
              transform: scale(1.2);
              opacity: 0.7;
            }
            100% {
              transform: scale(1.4);
              opacity: 0;
            }
          }
        `}
      </style>
    </>
  );
};

export default Navbar;
